import React from 'react';
import Navbar from './Navbar';

const Cart = () => {

    return (
        <div>
            <Navbar></Navbar>
            <div id="myModal"  className="cart-modal" onLoad={setTimeout(hideModal(), 3000)}>
                <div id="modal-content" className="modalContent" >
                    <span id="close" className="closeIcon" onClick={hideModal}>&times;</span>
                    <div className="modalContainer">
                        <h2 className="cart-text">"Empty Cart"</h2>
                    </div>
                </div>
            </div>
        </div>
    )
    setTimeout(function(){ alert("Hello"); }, 3000);
    function hideModal() {
        let modal = document.getElementById("myModal");
        modal.style.display = "none";
    }
}

export default Cart;
